import { createSlice } from "@reduxjs/toolkit";
const initialState = {
    weatherHistory: []
}

export const weatherSlice = createSlice({
    name: "weather",
    initialState,
    reducers: {
        insertCity: (state, action) => {
            const existingJson = state.weatherHistory.find((weather) => weather.Location === action.payload.Location);

            if (!existingJson) {
                state.weatherHistory.push(action.payload);
            }
        }
    }
})
